$$.control.registerControl("rootPage",{deps:["breizbot.broker"],template:'<div bn-control="brainjs.map" \n\tstyle="height: 100%"\n\tbn-iface="map"\n\tbn-data="{\n\t\tcenter: {lat: 48.39, lng: -4.486},\n\t\tscale: true,\n\t\tcoordinates: true\n\t}"\n\t></div>',init:function(t,e){const a=$$.viewController(t);e.register("homebox.map.updateShape.*",t=>{const e=t.topic.split(".").pop(),n=t.data;if(null!=n)try{a.scope.map.updateShape(e,n)}catch(t){a.scope.map.addShape(e,n)}else a.scope.map.removeShape(e)})}});